  // Simulate network delay
  await new Promise(resolve => setTimeout(resolve, 2500));

  // In a real scenario, you would use the file to make a request to your backend,
  // which then calls the Gemini API.
  // The response structure below is a simplified mock-up of what Gemini might return.

  // Note: The API key you provided (AIzaSyDk...) would be used by your backend server,
  // NOT directly in the frontend like this.

  console.log(`Simulating API call for file: ${file.name}. In a real app, a backend would use its Gemini API key here.`);

  return {
    data: {
      candidates: [
        {
          content: {
            parts: [
              { text: `Ïù¥ ÏÇ¨ÏßÑÏùÄ ${file.name}Ïóê ÎåÄÌïú Í≤ÉÏúºÎ°ú, ÌôîÏ∞ΩÌïú ÎÇ† ÏïºÏô∏ÏóêÏÑú Ï¥¨ÏòÅÎêú Í≤ÉÏúºÎ°ú Î≥¥ÏûÖÎãàÎã§. Ïó¨Îü¨ ÏÇ¨ÎûåÏù¥ Ï¶êÍ≤ÅÍ≤å ÏõÉÍ≥† ÏûàÏúºÎ©∞, Î∞∞Í≤ΩÏóêÎäî Ìë∏Î•∏ ÎÇòÎ¨¥ÏôÄ ÌïòÎäòÏù¥ Î≥¥ÏûÖÎãàÎã§. ÏÇ¨ÏßÑÏùò Ï†ÑÏ≤¥Ï†ÅÏù∏ Î∂ÑÏúÑÍ∏∞Îäî Îß§Ïö∞ Î∞ùÍ≥† Í∏çÏ†ïÏ†ÅÏûÖÎãàÎã§.` },
              { text: "Ï£ºÏöî Í∞ùÏ≤¥Î°úÎäî ÏÇ¨Îûå, ÎÇòÎ¨¥, ÌïòÎäò, ÏûîÎîîÎ∞≠ Îì±Ïù¥ Ïù∏ÏãùÎê©ÎãàÎã§." },
