              {
                inlineData: { // This part would typically contain image data or other structured info
                  objectsDetected: [
                    { name: 'ÏÇ¨Îûå', confidence: 0.96, boundingBox: [0.1, 0.2, 0.5, 0.8] },
                    { name: 'ÎÇòÎ¨¥', confidence: 0.90, boundingBox: [0.5, 0.1, 0.9, 0.9] },
                    { name: 'ÎØ∏ÏÜå', confidence: 0.98, category: 'ÌëúÏ†ï' },
                    { name: 'ÌïòÎäò', confidence: 0.85 },
                  ],
                  dominantColors: ['#5DBB63', '#4A90E2', '#F8E71C', '#FFFFFF', '#333333'],
                  ocrDetectedText: null, // e.g., "Vacation 2024"
                }
              }
            ]
          },
          safetyRatings: [
            { category: 'HARM_CATEGORY_HARASSMENT', probability: 'NEGLIGIBLE' },
            // ... other safety ratings
          ]
        }
      ],
      promptFeedback: {
        safetyRatings: [
            { category: 'HARM_CATEGORY_DANGEROUS_CONTENT', probability: 'NEGLIGIBLE' },
            // ... other safety ratings for the prompt itself
        ]
      }
    }
  };
}

function PhotoAnalysis() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [previewUrl, setPreviewUrl] = useState(null);
  const [analysisResult, setAnalysisResult] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleFileChange = useCallback((event) => {
    const file = event.target.files[0];
    if (file) {
      setSelectedFile(file);
      setPreviewUrl(URL.createObjectURL(file));
      setAnalysisResult(null);
      setError(null);
    } else {
      setSelectedFile(null);
      setPreviewUrl(null);
    }
  }, []);

  const handleAnalysis = useCallback(async () => {
    if (!selectedFile) return;

    setIsLoading(true);
    setAnalysisResult(null);
    setError(null);

